Info:
----------
Elementary is an American crime drama series that premiered on CBS on September 27, 2012.


Plot:
----------
Elementary presents a contemporary update of Sir Arthur Conan Doyle's character Sherlock Holmes set in the United States. It stars Jonny Lee Miller as Sherlock Holmes and Lucy Liu as Dr. Joan Watson. Holmes is a former consultant to Scotland Yard, and also an addict. He travels to New York City to check into a rehabilitation center then lives with Watson, who becomes his sober companion and eventually his apprentice.


